import React from 'react'
import { logout } from '../../services/operations/authAPI'

export const ConfirmationModel = ({confirmationModel,setConfirmationModel}) => {
  return (
    <div>{confirmationModel && <div className="w-[500px] bg-black">
            <div>Do you really want loggout</div>
            <button onClick={()=>setConfirmationModel(false)}>Cancel</button>
            <button onClick={()=>{
                logout()
            }}>Loggout</button>
    </div>}</div>
  )
}
